import React, { Component } from "react";
import ReactDOM from 'react-dom';

import Palette from 'react-palette'

//Hardcoding to get images for now
import logo from './nycoreLogo.jpeg';
import Fade from 'react-reveal/Fade';

import './index.css';

class MainLogoSection extends Component {
    render(){
        return(
            <div className="LogoHolder">
                <img src={logo} alt="logo" className="logo" style={{paddingBottom:10}}></img>
                <Fade left>
                    <h2 style={{paddingRight:100}}>New York Collective</h2>
                </Fade>
                <Fade right>
                    <h2 style={{paddingLeft:100, paddingBottom:10}}>of Radical Educators</h2>
                </Fade>
                <hr></hr>
                <h3 style={{paddingTop:10}} className="annualGreet">NYCoRE's #th Annual Conference</h3>
            </div>
        )
    }
}

class MainComponenet extends Component {
    render(){
        return(
            <MainLogoSection />
        )
    }
}

ReactDOM.render(<MainComponenet/>,document.getElementById("root"))
